query:
fragment TokenFields on Token {
  id
  name
  symbol
  derivedETH
  tradeVolume
  tradeVolumeUSD
  untrackedVolumeUSD
  totalLiquidity
  txCount
  __typename
}

query tokens {
  tokens(block: {number: 980288}, where: {id: "0xc65f62d372aa50e99b2a564ddb418a6bc84faa15"}) {
    ...TokenFields
    __typename
  }
  pairs0: pairs(where: {token0: "0xc65f62d372aa50e99b2a564ddb418a6bc84faa15"}, first: 50, orderBy: reserveUSD, orderDirection: desc) {
    id
    __typename
  }
  pairs1: pairs(where: {token1: "0xc65f62d372aa50e99b2a564ddb418a6bc84faa15"}, first: 50, orderBy: reserveUSD, orderDirection: desc) {
    id
    __typename
  }
}
